   [121]={next_id=122, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="人类的科技发展至今，无论是工业能源还是军事武器，都围绕在物质层面利用虚粒子的结晶——星彩源晶去创造事物。", msg_color="", msg_size=0, talker="维拉提亚教皇", audio="", img="arts/ui/bg/story/storybg_12_103.jpg", video_url="", music_id="0", background_music="", model_tid={{ 2, "7152_1", 0, 0, 31, 175.5}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, model_show_effect={{}}, update_model={{ 2,1}}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=1, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
   [122]={next_id=123, abreast_id={}, pType =1, cg_type =10, dialog=1, msg="我们切割、重组、燃烧星彩源晶……就像石器时代的猿猴摆弄燧石。", msg_color="", msg_size=0, talker="维拉提亚教皇", audio="", img="arts/ui/bg/story/storybg_12_103.jpg", video_url="", music_id="0", background_music="", model_tid={{ 2, "7152_1", 0, 0, 31, 175.5}}, model_pos={{ 0,0,0}}, model_move_pos={}, model_exit={}, model_show_effect={{}}, update_model={{ 2,1}}, role_act={}, head_path="", shake_ani=0, grad_time=0, is_memory=1, roll_str="",roll_bg ="", static_pic ="", prefab_path ="", runTalkTime =0, destoryTime =0, clickTimes =0, effPos={ 0,0,0},effUrl="", waitIDs = {}},
